import { useState } from 'react';
import { ProTable } from '@ant-design/pro-table';

function ProtableSearch() {
  const [searchValue, setSearchValue] = useState('');

  function handleSearchChange(event) {
    setSearchValue(event.target.value);
  }

  const columns = [
    {
      title: 'Name',
      dataIndex: 'name',
      key: 'name',
    },
    {
      title: 'Age',
      dataIndex: 'age',
      key: 'age',
    },
    {
      title: 'Address',
      dataIndex: 'address',
      key: 'address',
    },
  ];

  const dataSource = [
    {
      name: 'John Doe',
      age: 30,
      address: '123 Main St',
    },
    {
      name: 'Jane Doe',
      age: 25,
      address: '456 Elm St',
    },
    // more data here
  ];

  const tableProps = {
    columns,
    dataSource,
    search: {
      onSearch: () => {
        // do something with the search value, like filter the data source
      },
      optionRender: () => (
        <input type="text" value={searchValue} onChange={handleSearchChange} />
      ),
    },
  };

  return <ProTable {...tableProps} />;
}
